  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112301 includes chemical,
  discrete sample, physical and profile data collected from Soyo Maru in the North
  Pacific Ocean from 1998-04-14 to 1998-04-29 and retrieved during cruise PACIFICA_49SO19980414
  and SY9804. These data include ALKALINITY, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12
  (CFC-12), DISSOLVED INORGANIC CARBON, HYDROSTATIC PRESSURE, NITRATE + NITRITE CONTENT
  (CONCENTRATION), PHOSPHATE, SALINITY, SILICATE and WATER TEMPERATURE. The instruments
  used to collect these data include CTD, Coulometer for DIC measurement and bottle.
  These data were collected by Tsuneo Ono and Katsuyuki Sasaki of National Research
  Institute of Fisheries Science as part of the PACIFICA_49SO19980414 data set.nnPACIFICA
  (PACIFic ocean Interior CArbon) was an international collaborative project for the
  data synthesis of ocean interior carbon and its related parameters in the Pacific
  Ocean. The North Pacific Marine Science Organization (PICES), Section of Carbon
  and Climate (S-CC) supported the project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
